import React from "react";
import { Jumbotron as Jumbo, Container } from "react-bootstrap";
import styled from "styled-components";
import boatImage from "./img/jumbotrone.jpg";
import "./styles/jumbotrone.css";
import { makeStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";

const Styles = styled.div`
  .jumbo {
    background: url(${boatImage}) no-repeat fixed bottom;
    background-size: cover;
    color: #efefef;
    height: 200px;
    position: relative;
    z-index: -2;
  }

  .overlay {
    background-color: black;
    opacity: 0.2;
    position: absolute;
    top: -1%;
    left: 0;
    bottom: 0;
    right: 0;
    z-index: ;
  }
`;
const useStyles = makeStyles(theme => ({
  margin: {
    margin: theme.spacing(1)
  },
  extendedIcon: {
    marginRight: theme.spacing(1)
  }
}));

export function Jumbotron() {
  const hStyle = headerStyle();
  return (
    <Styles>
      <Jumbo fluid className="jumbo">
        <div className="overlay"></div>
        <Container>
          <h1
            style={{
              color: "white",
              fontWeight: "900",
              fontSize: "50px"
            }}
          >
            <Button
              variant="outlined"
              color="secondary"
              className={hStyle.button}
              size="large"
            >
              Complex Bid Module Integration
            </Button>
          </h1>
          <p style={{ color: "white", fontWeight: "900" }}>
            We are providing the best service cost effectively.
          </p>
        </Container>
      </Jumbo>
    </Styles>
  );
}
